import styled from 'styled-components';

export const paymentFormContainer = styled.div`
  height: 300px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

export const formContainer = styled.form`
  height: 100px;
  min-width: 500px;
`;

export const paymentButton = styled.div`
  margin-left: auto;
  margin-top: 30px;
`;
